import React from 'react';
import './App.css';
import Todos from './components/Todos'

function App() {
  state = {
    todos: [
        {
          id: 1,
          title: 'Tell a tale about a tail',
          completed: false
        }
    ]
  }
  return (
    <div className="App">
      <Todos/>
    </div>
  );
}

export default App;
